import React from 'react'
import { useRef } from 'react'

const App = () => {

  const inp = useRef(null)
 const submit = e => {
  e.preventDefault()
  console.log(inp.current.value)
 }
  return (
    <div className='app'>
      <form
      onSubmit={submit}
        className='form_css'>
        <input
          className='inp_css'
          id='inp'
          ref={inp}
        />

        <button
          className='btn_css'

          type='submit'>
          Submit
        </button>
      </form>
    </div>
  )
}

export default App
